import { FormProvider, useForm } from 'react-hook-form'; 
import FormLogin from '../../model/Form/FormLogin';

const LoginPage: React.FC = () => {
    const formMethods = useForm();

    return (
        <FormProvider {...formMethods}> 
            <FormLogin /> 
        </FormProvider>
    );
}

export default LoginPage;
